Everyone is hyped about mochi desserts lately so I went to @mochinut_us in Irvine for some #mochidonuts ! 

I just wanted to get one to satisfy my sweet tooth😅 but you can only either get half dozen or a dozen donuts. So I ordered some ube, chocolate pretzel, original, and churro mochinuts. I tried the chocolate pretzel #mochinut while it was still hot. It had some hazelnut crumbles around the edge. The donut had a crisp outside and a soft (a bit too soft) inside, but it was still chewy! 

Personally, I prefer this texture than the ones at Modo but definitely can’t beat #misterdonut’s Pon De Ring! 

Overall, their donuts were a bit too sweet for my liking and you MUST finish everything within the same day as my remaining 5 donuts were stale and greasy the next day. I wish they could just let me buy one donut lol 

Now I don’t know what to do with the leftover donuts and I simply stored them in the freezer… Please let me know what I can do with those donuts!🥺

What I ordered:
Half dozen of mocha donuts $16.5
Ube 
Chocolate pretzel 
Original 
Churro

