+
This kawaii donut was my first ever digital artwork with my new XP-Pen tablet drawn in Photoshop. I took a class on Skillshare and the instructor had us draw some kawaii food, so I'll be uploading a few of my results here. 
+
I paired the donut up with a retro background that I made in Clip Studio Paint. I absolutely love vaporwave/citypop style so much that maybe I'll just end up making it my art style from now on 🤔
+
I learned from this lesson that drawing circles is really annoying lol. But I don't want to rely on the shape tools because I want my art to look more organic and not so manufactured. So one of my current goals is to get better at drawing smooth circles 🌝
